import LoginForm from "./components/loginform/LoginForm";
import "./App.css"
import { Connexion } from "./components/Connexion";
import { BrowserRouter, Routes, Route} from "react-router-dom";
import { PasseOublie } from "./components/PasseOublie";
import { Principal } from "./Dashboard/Principal";
import {Dashboard } from './Dashboard/Dashboard'

function App() {
  return (
    <BrowserRouter>
      <main>
        <Routes>
          <Route path="/" element={<LoginForm />}/>
          <Route path="/connexion" element={<Connexion />}/>
          <Route path="/PasseOublie" element={<PasseOublie />}/>
          <Route path="/Se connecter" element={<Principal />}/>
        </Routes>

        <Routes>
          <Route path="/" element={<Principal />}/>
          <Route path="index" element={<Dashboard />}/>
          <Route path="listeHotel" element={<ListeHotel />}/>
        </Routes>



      </main>
    </BrowserRouter>
  );
}

export default App
